function mailTo(t){return t?"mailto:"+t:""}function setBgImgUrl(t){return"background-image: url("+t+");"}function humanReadable(t){if(0==t)return"0";var o=Math.floor(Math.log(t)/Math.log(1e3));return parseFloat((t/Math.pow(1e3,o)).toFixed(1))+[""," k"," M"," B"," T"][o]}function getReposURL(t){return"https://github.com/"+t+"?tab=repositories"}function getFollowersURL(t){return"https://github.com/"+t+"?tab=followers"}function getFollowingURL(t){return"https://github.com/"+t+"?tab=following"}function getUserPageURL(t){return"https://github.com/"+t}